            <div id="text1">
				<p>8/1<br>
				혼자 밥을 먹기 시작한지 2주가 다 되어가니 이것도 익숙해 진다.
			</p><br><p>
				8/20<br>
				부장과 죽이 척척 맞던 옆 부서 차장님이 <a href ="https://news.sbs.co.kr/news/endPage.do?news_id=N1000321621&plink=OLDURL" target="_blank">임신을 했으면 아기한테 집중해야 한다며 직원들에게 사직을 권유</a>임하다 찔려서 회사에서 난리가 났다. 아무래도 사직을 권한 진원이 임원진 딸래미였다는 것을 몰랐던 것 같다.
				그 차장 등신이 역으로 권고 사직을 당할 것 같은데 참 꼬시다.
			</p><br>
            </div>
            <div id="text2">
				<p>
					8/26<br>
					부장 <span class="q">새끼</span>가 오늘도 쓸데 없는 것으로 불러서 쓸데 없는 것으로 <span class="q">개지랄</span>을 시전했다.
					점점 참기 힘들어진다. 
				</p>
